

export async function authLogin(brand) {

  let brandUrl = "";
  let brandBody = "";
  let visitHome = "";

  switch (brand) {

    case "NA":
      brandUrl = "https://qa.na.eproducts.basf-coatings.com/api/auth/basf-federation";
      brandBody = {
        "SAMLResponse": "",
        "RelayState": "https://qa.na.eproducts.basf-coatings.com"
      };
      visitHome = "https://qa.na.eproducts.basf-coatings.com/menu/color";
      break;
    case "GL":
      brandUrl = "https://qa.gl.eproducts.basf-coatings.com/api/auth/basf-federation";
      brandBody = {
        "SAMLResponse": "",
        "RelayState": "https://qa.gl.eproducts.basf-coatings.com"
      };
      visitHome = "https://qa.gl.eproducts.basf-coatings.com/menu/color";
      break;
    case "RM":
      brandUrl = "https://qa.rm.eproducts.basf-coatings.com/api/auth/basf-federation";
      brandBody = {
        "SAMLResponse": "",
        "RelayState": "https://qa.rm.eproducts.basf-coatings.com"
      };
      visitHome = "https://qa.rm.eproducts.basf-coatings.com/";
      break;
  }


  await cy.request({
    log: true,
    method: 'POST',
    form: true,
    headers: { "Referer": "https://federation-qa.basf.com/" },
    url: brandUrl,
    body: brandBody,
  }).then(() => {
    cy.visit(visitHome);
    cy.get('button[id="onetrust-accept-btn-handler"]', { timeout: 20000 }).click();
  });

}